import React from "react";
import { Card, Col, Row, Icon, Avatar } from 'antd';
const { Meta } = Card;

test = () => {
  console.log("Test")
}

const LayerOptions = () => (
  <div>
    <Col span={8}>
      <Card
      style={{width: 200}}
        actions={[<Icon type="picture" onClick={this.test} />, <Icon type="plus-square" />]}
      >
        <Meta
          title="Card title"
          description="This is the description"
        />
      </Card>
    </Col>
    
    
  </div>
);

export default LayerOptions;
